    "2015-12-16T06:04:09.600481",nt"name": "a80-6segy-txt-seismic-reflection-profiles-in-seg-y-format-from-southern-rhode-island-sound",nt"isopen":
    false,nt"url": null,nt"notes": "During 1980, the U.S. Geological Survey
    (USGS) conducted a seismic-reflection survey utilizing Uniboom seismics in southern
    Rhode Island Sound aboard the Research Vessel Asterias. This cruise totalled 3 survey
    days. Data from this survey were recorded in analog form and archived at the USGS.
    Due to recent interest in the geology of Rhode Island Sound and in an effort to
    make the data more readily accessible while preserving the original paper records,
    the seismic data from this cruise were scanned and converted to TIFF images and
    SEG-Y data files. Navigation data were converted from LORAN-C time delays to latitudes
    and longitudes, which are available in ESRI shapefile format and as eastings and
    northings in space-delimited text format. For more information on the seismic surveys
    see http://woodshole.er.usgs.gov/operations/ia/public_ds_info.php?fa=1980-012-FA
    These data are also available via GeoMapApp (http://www.geomapapp.org/) and Virtual
    Ocean ( http://www.virtualocean.org/) earth science exploration and visualization
    applications.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
